(function(a, b) {
    a.src = b;
    a.onload = function() {
        jQuery.noConflict();
        console.log("jQueryEverywhere has taken over " + window.location.href + "!");
    };
    document.head.appendChild(a);
})(document.createElement('script'), '//code.jquery.com/jquery-latest.min.js')
